import { useCatalogContext } from '../hooks/useCatalogContext'

// date fns
import formatDistanceToNow from 'date-fns/formatDistanceToNow'

const CatalogDetails = ({ catalog }) => {
  const { dispatch } = useCatalogContext()

  const handleClick = async () => {
    const response = await fetch('/api/catalog/' + catalog._id, {
      method: 'DELETE'
    })
    const json = await response.json()

    if (response.ok) {
      dispatch({type: 'DELETE_CATALOG', payload: json})
    }
  }

  return (
    <div className="catalog-details">
      <h4>{catalog.title}</h4>
      <p><strong>Machinery Type: </strong>{catalog.load}</p>
      <p><strong>Price in $: </strong>{catalog.reps}</p>
      <p>{formatDistanceToNow(new Date(catalog.createdAt), { addSuffix: true })}</p>
      <span className="material-symbols-outlined" onClick={handleClick}>delete</span>
    </div>
  )
}

export default CatalogDetails
